int lcd_in_bound(int x , int y){
	if(x < 0 || x > 320){
		return 0;
	}
	if(y < 0 || y > 240){
		return 0;
	}
	return 1;
}

int lane_buffer_in_bound(int x , int y){
	if(x < 0 || x > 177){
		return 0;
	}
	if(y < 0 || y > 50){
		return 0;
	}
	return 1;
}

void remove_newline(char * str){
    char * back = str;
    do{
        if(*back == 0x0A){
          *back = 0;
					return;
				}
    }while(*back++ != '\0');
}

