void draw_hit(int x , int y , enum HIT_TYPE hit_type){
	int i,j;
	
	for(j = 0 ; j < 50 ; ++j){
		for( i = 0 ; i < 50 ; ++i){
			//check if it is inside the screen
			if(lane_buffer_in_bound( x + i , y + j)){
				if(hit_type == good){
					if(hit_good[(i) + 50 * (j)] != 0x7663){
						lane_buffer[ (x + i) + ( buffer_width * (y + j))] = hit_good[(i) + 50 * (j)];
					}
				}
				else{
					if(hit_okay[(i) + 50 * (j)] != 0x7663){
						lane_buffer[ (x + i) + ( buffer_width * (y + j))] = hit_okay[(i) + 50 * (j)];
					}
				}	
			}
		}
	}
}

void draw_note(int x , int y , enum NOTE_TYPE type){
		
	int i,j;
	
	for(j = 0 ; j < 25 ; ++j){
		for( i = 0 ; i < 25 ; ++i){
			//check if it is inside the screen
			if(lane_buffer_in_bound( x + i , y + j)){
				// we use 0x7663 as background, cut it out now
				if(blue_note[(i) + 25 * (j)] != 0x7663){
					if(type == blue){
						lane_buffer[ (x + i) + ( buffer_width * (y + j))] = blue_note[(i) + 25 * (j)];
					}
					else{
						lane_buffer[ (x + i) + ( buffer_width * (y + j))] = red_note[(i) + 25 * (j)];
					}
				}
			}
		}
	}
	
}


