void handleTouch(){
	strType_XPT2046_Coordinate point= Get_TouchedPoint();
	
	if(mode == menu){
		// enter game mode
		if(check_touchedInside(20,20,220,95)){
				mode = game;
				scan_map_files();				
				display_mode(mode);
		}
		
		// enter input mode
		if(check_touchedInside(20,150,220,225)){
				mode = input;
				display_mode(mode);
		}		
		
		// enter audio testing mode
		if(check_touchedInside(20,240,220,290)){
				mode = audio_testing;
				display_mode(mode);
		}		
		
	}
	else if(mode == game){
		// back button
		if(check_touchedInside(20,260,80,300)){
			mode = menu;
			display_mode(mode);
		}
		
		// start game button
		if(check_touchedInside(20,20,170,100)){
			mode = in_game;
			display_mode(mode);
		}
		
		// prev button
		if(check_touchedInside(30,170,90,210)){
			if(current_map_index > 0){
				--current_map_index;
				display_mode(mode);
			}
		}
		
		// next button
		if(check_touchedInside(150,170,210,210)){
			if(current_map_index < map_num - 1){
				++current_map_index;
				display_mode(mode);
			}
		}
	}
	else if(mode == input){
		// back button touched
		if(check_touchedInside(20,260,80,300)){
			mode = menu;
			display_mode(mode);
		}
		
		// down button touched
		if(check_touchedInside(73,174,133,214)){
			if(sensitivity_level > 0){
				--sensitivity_level;
			}
			char sen_level_char[2];
			sen_level_char[0] = number2char(sensitivity_level);
			sen_level_char[1] = '\0';
			LCD_DrawString( 160, 144, sen_level_char);
		}
		
		// up button touched
		if(check_touchedInside(73,94,133,134)){
			if(sensitivity_level < 5){
				++sensitivity_level;
			}
			char sen_level_char[2];
			sen_level_char[0] = number2char(sensitivity_level);
			sen_level_char[1] = '\0';
			LCD_DrawString( 160, 144, sen_level_char);
		}
		
		// config key touched
//		if(check_touchedInside(140,260,220,300)){
//			printf("map function is not implemented yet\n");
//		}
	}
	else if(mode == audio_testing){
		// down button touched
		if(check_touchedInside(73,174,133,214)){
			--volume;
		}
		
		// up button touched
		if(check_touchedInside(73,94,133,134)){
			++volume;
		}
		
		// back button
		if(check_touchedInside(20,260,80,300)){
			mode = menu;
			display_mode(mode);
		}
	}
	else if(mode == result){
		// back button
		if(check_touchedInside(20,260,80,300)){
			mode = game;
			display_mode(mode);
		}
	}
}


